import logo from "./logo.svg";
import "./App.css";

import { IShoppingSale } from "./api/structures/shoppings/sales/IShoppingSale";
import saleService from "./utils/service/sale.service";

interface Props {
  sale: IShoppingSale;
}

function App({ sale }: Props) {
  console.log("sale:", sale);
  return (
    <div className="App">
      <form>
        {sale.units.map(({ id }) => {
          <section key={id}>유닛</section>;
        })}
        <footer>
          <ul>
            <li>
              <button>장바구니</button>
            </li>
            <li>
              <button>바로구매</button>
            </li>
          </ul>
        </footer>
      </form>
    </div>
  );
}

export default App;
